import React from 'react'
import MaterialTable from 'material-table'
import PropTypes from "prop-types";

function FinancialPartnerList(props) {

    return (
      <div style={{ maxWidth: '100%' }}>
        <MaterialTable
        actions={[
            {
              icon: 'edit',
              tooltip: 'Edit Financial Partner',
              onClick: (event, rowData) => {
                console.log(event,rowData);
                props.handleEdit(1)
              }
            },
            {
                icon: 'delete',
                tooltip: 'delete Financial Partner',
                onClick: (event, rowData) => {
                  console.log(event,rowData);
                }
              }
          ]}
          columns={[
            { title: 'Name', field: 'name' },
            { title: 'IS ACTIVE', field: 'surname' },
            { title: 'SUGGESTED BY', field: 'birthYear' },
          ]}
          data={[{ name: 'Mehmet', surname: 'Baran', birthYear: 1987, birthCity: 63 }]}
          title="Financial Partner"
        />
      </div>
    )

}

FinancialPartnerList.propTypes = {
    handleEdit: PropTypes.function,
  };


export default FinancialPartnerList;
